export default {
		logout: async() => {

		await storeValue('jwt',undefined);
		await storeValue('tabValue',"Login");		
		await storeValue('id',undefined);
		await storeValue('cust_id',undefined);

		await navigateTo('Client Details',{});
		await storeValue('dataArray',undefined);
		await resetWidget('login_form',true);
		await showAlert("Logged out successfully",'success');
	}

}
